  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0145836 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1503 in the
  Tasman Sea from 2015-02-27 to 2015-03-11. These data include CURRENT SPEED - EAST/WEST
  COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The instruments used
  to collect these data include ADCP and GPS. These data were collected by Matthew
  Alford of University of California - San Diego; Scripps Institution of Oceanography
  as part of Tasman Tidal Dissipation Experiment (T-TIDE). The Lamont-Doherty Earth
  Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling
  Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
